      SELECT + - col0 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( 61 - + col2, CAST ( + col1 AS INTEGER ), 78 + - 29 );
  - name: tab1

outputs:
